import React from 'react';
import { Panel, FlexboxGrid } from 'rsuite';

function ItemCard() {
  return (
    <FlexboxGrid style={{ marginLeft: 20 }}>
      <img
        src='https://i.pinimg.com/474x/e6/3d/69/e63d6960e27825cc4a32d5b984de2994.jpg'
        height='140'
        alt='juup'
      />
      <Panel header='Item Name'>
        <p>
          <small>Item Description</small>
          <ul>
            <li>Size: </li>
            <li>Item code: </li>
          </ul>
        </p>
      </Panel>
    </FlexboxGrid>
  );
}

export default ItemCard;
